// ==UserScript==
// @name        Clean Up instances
// @namespace   Violentmonkey Scripts
// @match       https://neal.fun/infinite-craft/*
// @grant       unsafeWindow
// @version     1.0
// @author      - , redtomato2589 for svgs
// @description 7/4/2025, 2:13:36 AM
// ==/UserScript==
window.addEventListener("load",async ()=>{
let limitInstances=20;
let imgSrc="data:image/svg+xml;base64,"
let disabledSrc="data:image/svg+xml;base64,"
let enabled=true;


  if( await localStorage.getItem("limitInstances"))
  {

   limitInstances=JSON.parse(await localStorage.getItem("limitInstances"));


  }




let clearIcon= document.querySelector(".clear");
let clone= clearIcon.cloneNode(true);
  clearIcon.parentNode.replaceChild(clone,clearIcon);

clone.src=imgSrc;
clone.style.width="22px";
clone.style.height="32px";
clone.style.filter="";
  clone.addEventListener("click",(e)=>{

  if (e.shiftKey)
   {
     enabled=!enabled;
     if(enabled)
       {
         clone.src=imgSrc;
         clone.style.width="32px";
         clone.style.height="32px";
       }else
         {
         clone.src=disabledSrc;
          clone.style.width="32px";
         clone.style.height="32px";
         }

   }else
     {
       clearIcon.click();
     }

})



	function set_up_settings() {

		let menu = document.querySelector(".menu");
		menu.addEventListener("click", () => {
			let interval = setInterval(
				() => {

					let settings = document.querySelector(".modal-tabs");
					if (settings == null)
						return;

					clearInterval(interval);

					let modal1 = document.querySelector(".modal");
					modal1.style.maxWidth = "650px";
					let cleanerSettings_container = document.createElement("div");

					if (settings == null) {


						settings = document.querySelector(".container");
						cleanerSettings_container.style.position = 'absolute';
						cleanerSettings_container.style.left = '20px';
						cleanerSettings_container.style.top = '100px';
						cleanerSettings_container.style.width = '50px';
						cleanerSettings_container.style.height = '50px';

						cleanerSettings_container.classList.add('theme_settings_cont');



					}
					else {
						cleanerSettings_container.classList.add('setting');
						cleanerSettings_container.classList.add("modal-tab-wrapper");
						cleanerSettings_container.setAttribute("data-v-885fff84", "");
						cleanerSettings_container.classList.add("folder_settings_cont");
						ParentSource = settings;
					}



					var title = document.createElement("div");


					title.classList.add("modal-tab");
					title.setAttribute("data-v-885fff84", "");
					var textSpacer = document.createElement("div");
					var textDiv = document.createElement("div");
					textDiv.classList.add("modal-tab-text");
					textDiv.textContent = "Instances Cleaner";
					textDiv.setAttribute("data-v-885fff84", "");
					textSpacer.textContent = "/";
					textSpacer.classList.add('spacer');
					textSpacer.setAttribute("data-v-885fff84", "");
					cleanerSettings_container.appendChild(textSpacer);
					title.appendChild(textDiv);

					cleanerSettings_container.appendChild(title);
					settings.appendChild(cleanerSettings_container);
					var parentElement = document.querySelector(".modal");


					title.addEventListener("click", () => {

						while (parentElement.children[1].children.length > 1)
							parentElement.children[1].removeChild(parentElement.children[1].lastChild);
						if (parentElement.children[1].lastChild && parentElement.children[1].lastChild.style) {
							parentElement.children[1].lastChild.style.display = "none";
						} else
							if (parentElement.children[1].lastChild) {
								parentElement.children[1].children[0].style.display = "none";
							}

						title.classList.add("modal-tab-selected");

						var titleTabs = document.querySelector(".modal-tabs");
            var content = document.querySelector(".autoclenear-setting-content");
            if (content == null) {

			          content = document.createElement("div");
			          content.setAttribute("data-v-885fff84", "");
			          content.classList.add("about");

			          content.classList.add("autoclenear-setting-content");
			          parentElement.appendChild(content);

		          }else
                {
                   content.innerHTML = "";
                }

						for (var tab of titleTabs.children) {

							if (tab.querySelector(".modal-tab").querySelector(".modal-tab-text").textContent != title.textContent) {
								tab.querySelector(".modal-tab").addEventListener("click", () => {

									title.classList.remove("modal-tab-selected");
									if (parentElement.contains(content)) {
										parentElement.removeChild(content);
									}
								})
							}


						}
        let current= document.createElement("p");
            current.textContent="You have now "+ IC.getInstances().length+ " Instances"
            content.appendChild(current);  


            //add input and text
          let text= document.createElement("p");
            text.textContent="Choose how many instances are too many"
          let input= document.createElement("input");
            input.type="number"
            input.value=limitInstances;
             input.addEventListener("change",()=>{
             limitInstances=input.value;
             localStorage.setItem("limitInstances",JSON.stringify(limitInstances));


             });
          content.appendChild(text);
          content.appendChild(input);



					});
				}, 1);
		});

	}

  set_up_settings();


setInterval( ()=>{
  if(IC)
{
  if(enabled){
let instances=IC.getInstances();
if(instances.length>limitInstances)
IC.removeInstances(instances);
  }
}

},


7000)



});